INSERT INTO `pages`(`id`,`name`,`text`,`seo_title`,`seo_keywords`,`seo_description`,`url`,`code`,`noindex`,`is_disabled`,`created_at`,`updated_at`,`images`,`page_category_id`,`sort`) VALUES ( '63', 'a:2:{s:2:"ru";s:31:"1. Что такое wap click?";s:2:"en";s:31:"1. Что такое wap click?";}', 'a:2:{s:2:"ru";s:466:"Вапклик (wapclick) - это технология оплаты контента на сайте без ввода номера и кода подтверждения. Это легальный способ монетизации мобильного трафика, при котором абонент соглашается со стоимость и условиями подписки нажимая кнопку “ОК” или “Загрузить”.";s:2:"en";s:466:"Вапклик (wapclick) - это технология оплаты контента на сайте без ввода номера и кода подтверждения. Это легальный способ монетизации мобильного трафика, при котором абонент соглашается со стоимость и условиями подписки нажимая кнопку “ОК” или “Загрузить”.";}', 'N;', 'N;', 'N;', NULL, 'faq1', '1', '0', '1472740424', '1472740456', 'a:0:{}', '16', '1' );
INSERT INTO `pages`(`id`,`name`,`text`,`seo_title`,`seo_keywords`,`seo_description`,`url`,`code`,`noindex`,`is_disabled`,`created_at`,`updated_at`,`images`,`page_category_id`,`sort`) VALUES ( '64', 'a:2:{s:2:"ru";s:63:"2. Как происходит подписка на wap-click?";s:2:"en";s:63:"2. Как происходит подписка на wap-click?";}', 'a:2:{s:2:"ru";s:518:"Пользователь заходит на платник нужной тематики, с мобильного телефона или смартфона. Выбирает интересующий его контент и нажимает кнопку “ОК”, тем самым соглашаясь со стоимостью и правилами подписки. После успешной подписки пользователь получает ссылку для скачивания контента.";s:2:"en";s:518:"Пользователь заходит на платник нужной тематики, с мобильного телефона или смартфона. Выбирает интересующий его контент и нажимает кнопку “ОК”, тем самым соглашаясь со стоимостью и правилами подписки. После успешной подписки пользователь получает ссылку для скачивания контента.";}', 'N;', 'N;', 'N;', NULL, 'faq2', '1', '0', '1472740510', '1472740510', 'a:0:{}', '16', '2' );
INSERT INTO `pages`(`id`,`name`,`text`,`seo_title`,`seo_keywords`,`seo_description`,`url`,`code`,`noindex`,`is_disabled`,`created_at`,`updated_at`,`images`,`page_category_id`,`sort`) VALUES ( '65', 'a:2:{s:2:"ru";s:48:"3. В чем преимущества wap-click?";s:2:"en";s:48:"3. В чем преимущества wap-click?";}', 'a:2:{s:2:"ru";s:838:"Вапклик имеет множество преимуществ, среди которых хотелось бы выделить:<br>-	Абсолютно легальная схема работы, полностью согласованная с ОСС.<br>-	Отличный конверт, т.к пользователю не требуется вводить номер телефона либо скачивать мидлет для активации подписки.<br>-	Хороший доход на длинной дистанции. В отличии от смс подписка будет нести доход в течении нескольких месяцев.<br>-	Отсутствие фрода и штрафов со стороны операторов, при соблюдении правил работы.";s:2:"en";s:838:"Вапклик имеет множество преимуществ, среди которых хотелось бы выделить:<br>-	Абсолютно легальная схема работы, полностью согласованная с ОСС.<br>-	Отличный конверт, т.к пользователю не требуется вводить номер телефона либо скачивать мидлет для активации подписки.<br>-	Хороший доход на длинной дистанции. В отличии от смс подписка будет нести доход в течении нескольких месяцев.<br>-	Отсутствие фрода и штрафов со стороны операторов, при соблюдении правил работы.";}', 'N;', 'N;', 'N;', NULL, 'faq3', '1', '0', '1472740539', '1472740539', 'a:0:{}', '16', '3' );
INSERT INTO `pages`(`id`,`name`,`text`,`seo_title`,`seo_keywords`,`seo_description`,`url`,`code`,`noindex`,`is_disabled`,`created_at`,`updated_at`,`images`,`page_category_id`,`sort`) VALUES ( '66', 'a:2:{s:2:"ru";s:38:"4. Что такое платники?";s:2:"en";s:38:"4. Что такое платники?";}', 'a:2:{s:2:"ru";s:415:"Платник - это целевая страница (согласованная с ОСС), на которую попадает пользователь с вашего сайта либо рекламной сети. На платнике содержится информация об услуге и тип контента который получит пользователь после подписки.";s:2:"en";s:415:"Платник - это целевая страница (согласованная с ОСС), на которую попадает пользователь с вашего сайта либо рекламной сети. На платнике содержится информация об услуге и тип контента который получит пользователь после подписки.";}', 'N;', 'N;', 'N;', NULL, 'faq4', '1', '0', '1472740563', '1472740563', 'a:0:{}', '16', '4' );
INSERT INTO `pages`(`id`,`name`,`text`,`seo_title`,`seo_keywords`,`seo_description`,`url`,`code`,`noindex`,`is_disabled`,`created_at`,`updated_at`,`images`,`page_category_id`,`sort`) VALUES ( '67', 'a:2:{s:2:"ru";s:44:"5. Какой платник выбрать?";s:2:"en";s:44:"5. Какой платник выбрать?";}', 'a:2:{s:2:"ru";s:679:"Обязательно нужно использовать платники подходящие по тематике под ваш трафик. Так например, если у вас музыкальный портал то необходимо использовать музыкальный платник. Операторы категорически запрещают использовать для adult трафика платники других тематик.<br>В случае, если вы не знаете какой платник вам выбрать, вы можете попросить тех.поддержку выбрать его за вас.";s:2:"en";s:679:"Обязательно нужно использовать платники подходящие по тематике под ваш трафик. Так например, если у вас музыкальный портал то необходимо использовать музыкальный платник. Операторы категорически запрещают использовать для adult трафика платники других тематик.<br>В случае, если вы не знаете какой платник вам выбрать, вы можете попросить тех.поддержку выбрать его за вас.";}', 'N;', 'N;', 'N;', NULL, 'faq5', '1', '0', '1472740584', '1472740584', 'a:0:{}', '16', '5' );
